In previous situations something like this would have put me out for the remainder of the year with an oh well I'll start again in January. I made a decision that I was no longer going to continue that pattern and once the gym opened back up I immediately got right back to it. My gym partners @madisonfloriano and @jfransee00 were home from school and I wanted to set a great example for them as well.
This summer was hot! Probably the hottest on record and with yard work and  an insanely active 3 year old, I wasn't putting on the weight as quickly as I had opened. I kept my head down and kept pushing. I'm now up 20 plus lbs and half way to my first desired milestone. 
The lesson here is to never give up. Stay positive. #Hardwork and #dedication is all it takes. You will have #obstacles and defeats along the way but you gotta keep pushing. 
I say it all the time. The lessons you learn in the #gym will translate to all aspects of your life. Those tools will aid you in the #journey of becoming the best version of yourself. 
